import { Link, Route, Routes } from "react-router-dom"
import Dashbord from "../Pages/Dashbord"

function RoutPractice(){
    return (
        <div>
            <Link to='/' >Dashbord</Link>
            <Routes>
                <Route path="/" element={<Dashbord/>}/>
            </Routes>
            
        </div>
    )
}
export default RoutPractice
